+
+  <script>
+    (function($) {
+      $(document).ready(function() {
+        // Fetch latitude and longitude from data attributes
+        var get_latitude = $('#google-map').data('latitude');
+        var get_longitude = $('#google-map').data('longitude');
+
+        // Ensure that latitude and longitude exist
+        if (!get_latitude || !get_longitude) {
+          console.error("Latitude or Longitude data is missing.");
+          return;
+        }
+
+        // Initialize Google Map function
+        function initialize_google_map() {
+          var myLatlng = new google.maps.LatLng(get_latitude, get_longitude);
+
+          // Map options
+          var mapOptions = {
+            zoom: 14,
+            scrollwheel: false,
+            center: myLatlng
+          };
+
+          // Create the map
+          var map = new google.maps.Map(document.getElementById('google-map'), mapOptions);
+
+          // Create the marker
+          var marker = new google.maps.Marker({
+            position: myLatlng,
+            map: map
+          });
+        }
+
+        // Initialize Google Map once the API is loaded
+        if (typeof google !== 'undefined' && google.maps) {
+          google.maps.event.addDomListener(window, 'load', initialize_google_map);
+        } else {
+          console.error("Google Maps API failed to load.");
+        }
+      });
+    })(jQuery);
+  </script>
+
   <script src="{% static 'js/main.js' %}"></script>
 </body>

 </html>

